import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

const CoursePage = () => {
    return (
        <Container>
            <Row>
                <Col md={2}>type</Col>
            </Row>
            <Row>
                <Col md={12}>name</Col>
            </Row>
            <Row>
                <Col md={2}>btn</Col>
                <Col md={2}>close date</Col>
            </Row>
            <Row>
                <Col md={3}>format</Col>
                <Col md={3}>cost</Col>
                <Col md={3}>duration</Col>
                <Col md={3}>shedule</Col>
            </Row>
            <Row>
                module
            </Row>
        </Container>
    );
};

export default CoursePage;
